using Model.Entities;
using System.Net.Mail;
using System.Net;
using Data.Contracts;
using System.Net.Mime;

namespace SCCD.FacadePattern
{
    public class HistorialMailSubSystem
    {
        private IPersonaRepositorie _personaRepositorie;
        private IAulaRepositorie _aulaRepositorie;
        private Session _session = Session.GetInstance();
        public HistorialMailSubSystem(IPersonaRepositorie personaaRepositorie,
            IAulaRepositorie aulaRepositorie)
        {            
            _personaRepositorie = personaaRepositorie;
            _aulaRepositorie = aulaRepositorie;
        }
        public void EnviarMailHistorial(Historial Historial, int idAlumno, string accion)
        {
            SmtpClient smtpClient = new SmtpClient();
            smtpClient.Host = "smtp.gmail.com";
            smtpClient.Port = 587;
            smtpClient.EnableSsl = true;
            smtpClient.UseDefaultCredentials = false;
            smtpClient.DeliveryMethod = SmtpDeliveryMethod.Network;
            var config = new ConfigurationBuilder()
               .AddJsonFile("appsettings.json")
               .Build();

            string appPassword = config["AppPassword"];

            smtpClient.Credentials = new NetworkCredential("noreply.sccd@gmail.com", appPassword);

            MailMessage mailMessage = new MailMessage();
            Alumno alumno = null;
            if (accion == "nuevo" || accion == "modificado")
            {
                alumno = _personaRepositorie.GetAlumno(idAlumno);
                var padres = _personaRepositorie.ObtenerPadres();

                foreach (var padre in padres)
                {
                    if (padre is Padre)
                    {
                        foreach (var hijo in ((Padre)padre).Hijos)
                        {
                            if (hijo.Id == idAlumno)
                            {
                                mailMessage.Bcc.Add(padre.Email);
                                alumno = hijo;
                                break;
                            }
                        }
                    }else if (padre is Docente)
                    {
                        foreach (var hijo in ((Docente)padre).Hijos)
                        {
                            if (hijo.Id == idAlumno)
                            {
                                mailMessage.Bcc.Add(padre.Email);
                                alumno = hijo;
                                break;
                            }
                        }
                    }else if (padre is Directivo)
                    {
                        foreach (var hijo in ((Directivo)padre).Hijos)
                        {
                            if (hijo.Id == idAlumno)
                            {
                                mailMessage.Bcc.Add(padre.Email);
                                alumno = hijo;
                                break;
                            }
                        }
                    }
                }
            }
            else
            {
                bool salioBreak = false;
                alumno = _personaRepositorie.GetAlumno(idAlumno);
                var aulas = _aulaRepositorie.ObtenerTodosAsync();
                foreach (var aula in aulas)
                {
                    foreach (var alumnoDeAula in _aulaRepositorie.ObtenerAlumnosAula(aula.Id))
                    {
                        if (alumnoDeAula.Id == idAlumno)
                        {
                            mailMessage.Bcc.Add(_aulaRepositorie.ObtenerDocenteDeAula(aula.Id).Email);
                            salioBreak = true;
                            break;
                        }
                    }
                    if (salioBreak)
                    {
                        break;
                    }
                }
            }


            MailAddress mail = new MailAddress("noreply.sccd@gmail.com");

            mailMessage.From = mail;
            mailMessage.IsBodyHtml = true;
            mailMessage.Priority = MailPriority.High;
            string base64 = accion == "nuevo" || accion == "modificado" ? "" :
                         "";
            string backgroundColor = accion == "nuevo" ? "#2B4162" :
                         accion == "modificado" ? "#DFDF10" :
                         "#045F28";                         
            byte[] imageBytes = Convert.FromBase64String(base64);
            string imageName = Guid.NewGuid().ToString() + ".png";

            string htmlTemplate = $@"
            <html>
                <head>
                <link rel='preconnect' href='https://fonts.googleapis.com'>
                <link rel='preconnect' href='https://fonts.gstatic.com' crossorigin>
                <link href='https://fonts.googleapis.com/css2?family=Lato:ital,wght@0,100;0,300;0,400;0,700;0,900;1,100;1,300;1,400;1,700;1,900&display=swap' rel='stylesheet'>                    
                </head>
                <body>
                    <table style='border-radius: 40px; background-color: {backgroundColor}; margin: auto; width: 433px; height: 650px;'>
                        <tr style='text-align: center;'>
                            <td style='height: 25px;'>
                            <img src='https://cdn-icons-png.flaticon.com/512/16116/16116728.png' width='71' height='72' alt='' title='' class='img-small'>
                            </td>
                        </tr>
                        <tr>
                            <td style='border-radius: 40px; background-color: white; padding: 0px 20px 20px 20px;'>
                                <div class='divTextContainer' style='width: 99%; margin: 0px 4px 4px 4px;'>
                                    <img width='154' height='160' border=""0"" src='cid:{imageName}' style='display: block; background-position: center; background-repeat: no-repeat; background-size: contain; border: none; margin-left: 123px; margin-right: 96px; margin-bottom: 22px; margin-top: 10px;'>                                                                    
                                    <p style='sans-serif; width: 100%; text-align: center; margin: 0;'><strong>
                                        {(accion == "nuevo" ? $"Se ha agregado un nuevo Historial:<br><br>" +
                                        $"<u>Descripcion</u>: {Historial.Descripcion}<br>" +
                                        $"<u>Estado</u>: {Historial.Estado}<br>" +
                                        $"<u>Calificacion</u>: {Historial.Calificacion}"
                                        : accion == "modificado" ? $"Se ha modificado un Historial:<br><br>" +
                                        $"<u>Descripcion</u>: {Historial.Descripcion}<br>" +
                                        $"<u>Estado</u>: {Historial.Estado}<br>" +
                                        $"<u>Calificacion</u>: {Historial.Calificacion}"
                                        : $"El Historial \"<i>{Historial.Descripcion}</i>\", correspondiente al Alumno/a {alumno.Apellido}, {alumno.Nombre} ha sido firmado por:<br>" +
                                        $"<u>Usuario</u>: {_session.UserNameUserLogueado}<br>" +
                                        $"<u>Email</u>: {_session.EmailUserLogueado}")}
                                    </strong>                                     
                                    <p style = sans-serif; width: 100%; font-weight: 700; text-align: center; margin: 0;' > Nota: Esta dirección de correo envía emails automáticos. Por favor, no responda.</p>                              
                                    <p style = sans-serif; width: 100%; font-weight: 700; text-align: center; margin: 0;' >Ante cualquier duda o inconveniente, comuníquese con el docente y/o directivo correspondiente.</p>
                                    <br>
                                    <p style = sans-serif; width: 100%; font-weight: bold; text-align: center; margin: 0; text-decoration: underline;' ><strong><u>Referencias:</u></strong></p>
                                    <table style='width: 60%;'>
                                        <tr>
                                            <td style='text-align: left;'>
                                                <div style='display: inline-block; width: 15px; height: 15px; background-color: blue; margin-right: 5px;'></div> Nuevo
                                            </td>
                                        </tr>
                                        <tr>
                                            <td style='text-align: left;'>
                                                <div style='display: inline-block; width: 15px; height: 15px; background-color: darkgreen; margin-right: 5px;'></div> Aceptado/Firmado
                                            </td>
                                        </tr>
                                        <tr>
                                            <td style='text-align: left;'>
                                                <div style='display: inline-block; width: 15px; height: 15px; background-color: red; margin-right: 5px;'></div> Denegado
                                            </td>
                                        </tr>
                                        <tr>
                                            <td style='text-align: left;'>
                                                <div style='display: inline-block; width: 15px; height: 15px; background-color: yellow; margin-right: 5px;'></div> Leido/Modificado
                                            </td>
                                        </tr>
                                        <tr>
                                            <td style='text-align: left;'>
                                                <div style='display: inline-block; width: 15px; height: 15px; background-color: deepskyblue; margin-right: 5px;'></div> Seguridad
                                            </td>
                                        </tr>
                                    </table>                           
                                </div>
                            </td>
                        </tr>
                    </table>
                </body>
            </ html > ";

            mailMessage.Body = htmlTemplate;
            MemoryStream ms = new MemoryStream(imageBytes);
            LinkedResource inline = new LinkedResource(ms, "image/png")
            {
                ContentId = imageName,
                TransferEncoding = TransferEncoding.Base64
            };

            AlternateView view = AlternateView.CreateAlternateViewFromString(htmlTemplate, null, MediaTypeNames.Text.Html);
            view.LinkedResources.Add(inline);

            mailMessage.AlternateViews.Add(view);

            string calificacion = "";
            if (Historial.Calificacion != null || Historial.Calificacion > 0)
            {
                calificacion = Historial.Calificacion.ToString();
            }
            else
            {
                calificacion = "Sin calificacion";
            }            
            mailMessage.BodyEncoding = System.Text.Encoding.UTF8;
            if (accion == "nuevo")
            {
                mailMessage.Subject = $"Nuevo Historial - Alumno: {alumno.Nombre}, {alumno.Apellido}";
            }
            else
            {
                if (accion == "modificado")
                {
                    mailMessage.Subject = $"Historial Modificado - Alumno: {alumno.Nombre}, {alumno.Apellido}";
                }
                else
                {
                    mailMessage.Subject = $"Historial Firmado - Alumno: {alumno.Nombre}, {alumno.Apellido}";
                }

            }
            mailMessage.SubjectEncoding = System.Text.Encoding.UTF8;

            smtpClient.Send(mailMessage);
        }
    }
}
